import React from "react";

const renderMenu = items => {
    return <ul>
      { items.map(i => {
        return <li>
          <a href={i.link}>{ i.title }</a>
          { i.menu && renderMenu(i.menu) }
        </li>
      })}
    </ul>
  }
   
  export default function Menu ( ){
    const data = {
        "module_type": "menu",
        "title": "My Site",
        "menu": [{
            "link": "/home",
            "title": "Home"
          },
          {
            "link": "/Fruit",
            "title": "Fruit",
            "menu": [{
                "link": "/apples",
                "title": "Apples"
              },
              {
                "link": "/bananas",
                "title": "Bananas"
              },
              {
                "link": "/kiwi",
                "title": "Kiwi"
              },
              {
                "link": "/pears",
                "title": "Pears"
              }
            ]
          },
          {
            "link": "#",
            "title": "Vegetables",
            "menu": [{
                "link": "/carrots",
                "title": "Carrots"
              },
              {
                "link": "/celery",
                "title": "Celery"
              },
              {
                "link": "/potatoes",
                "title": "Potatoes"
              },
              {
                "link": "#",
                "title": "More",
                "menu": [{
                    "link": "/thirdlevel1",
                    "title": "3rd level menu"
                  },
                  {
                    "link": "/thirdlevel2",
                    "title": "3rd level two"
                  }
                ]
              }
            ]
          },
          {
            "link": "/about",
            "title": "About"
          },
          {
            "link": "/contact",
            "title": "Contact"
          }
        ]
      }
    return <nav>
      <h2>{ data.title }</h2>
      { renderMenu(data.menu) }
    </nav>
  }
